import React from 'react';
import jetiLogo from './Img/jetLogo.jpg';
import guiLogo from './Img/guiLogo.jpg';
import './style.css';

export function Stories() {

    return (
        <div className="stories-box">
            <ul className="stories-circles">
                <li className="user1">
                <img src={jetiLogo} alt="Logo" />
                    <p>Seu story</p>
                </li>
                <li className="user2">
                <img src={guiLogo} alt="Logo2" />
                    <p>glhrmrg</p>
                </li>
                <li className="user3">
                    <p>user3</p>
                </li>
                <li className="user4">
                    <p>user4</p>
                </li>
                <li className="user5">
                    <p>user5</p>
                </li>
            </ul>
        </div>

    )

};
